import React from "react";
import { Link, useSearchParams } from "react-router-dom";

import redPic from "../../assets/img/red.png";
import bluePic from "../../assets/img/blue.png";
import greenPic from "../../assets/img/green.png";

let step;
let query = "";
const SelectImgs = () => {
  const [searchParams] = useSearchParams();
  const maxCount = searchParams.get("maxSelect");
  const selectCount = searchParams.get("selectCount");
  const selectAns = searchParams.get("selectAns");
  if (selectCount + 1 < maxCount) {
    step = 2;
  } else { 
    step = 3;
  }
