  return (
    <>
      <div className="select-imgs">
        <Link className="item" to={`/step${step}/?maxCount=${maxCount}&selectCount=`} >
          <img src={redPic} alt="画像１" />
        </Link>
        <Link className="item" to={`/step${step}/?${query}&select${select}=2`}>
          <img src={bluePic} alt="画像２" />
        </Link>
        <Link className="item" to={`/step${step}/?${query}&select${select}=3`}>
          <img src={greenPic} alt="画像３" />
        </Link>
        <Link className="item" to={`/step${step}/?${query}&select${select}=4`}>
          <img src={redPic} alt="画像４" />
        </Link>
      </div>
    </>
  );
}

export default SelectImgs;
